(2, '2058996681552981', 'herbarium_msg_1', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"IMAGE\",\"example\":{\"header_handle\":[\"https:\\/\\/scontent.whatsapp.net\\/v\\/t61.29466-34\\/584965728_2058996684886314_4857019786298168045_n.jpg?ccb=1-7&_nc_sid=8b1bef&_nc_ohc=hl7PsorjuToQ7kNvwFESavE&_nc_oc=Adn0VU_Ae4BthpfQkQCIXbbWMnWKZwithcR_o6XPIhy4idz77QZh62xrHggbtgFJo-N2TWegtmJul12X6xrAyhze&_nc_zt=3&_nc_ht=scontent.whatsapp.net&edm=AH51TzQEAAAA&_nc_gid=LlYrfic6bsaCepY_0eoTJA&_nc_tpa=Q5bMBQGmAmXrXD6vo7x-JE4d-TeLh1ab8keKdulQKUqNo4ujzzwS7D_ZZQuXFI54B_ETmZ3Bl68bBw4kJA&oh=01_Q5Aa3wGRU3qOf6jRrgdi4h2cBhBCBzSAVrkeYf2eoeaJV3c9jw&oe=69C8F1E8\"]}},{\"type\":\"BODY\",\"text\":\"O sistema identificou atividade. Novas informa\\u00e7\\u00f5es podem surgir a qualquer momento.\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(3, '1125626446144789', 'althaia_fotos_link', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Oie! Aqui \\u00e9 a Alth@. Talvez seja a \\u00faltima vez que nos falamos. Saudade j\\u00e1!\\n\\nForam momentos de aprendizado, conex\\u00f5es e muita energia boa \\ud83d\\udc99! \\nAgora, \\u00e9 hora de levar tudo isso com voc\\u00ea e aplicar no dia a dia, mas sem perder a lembran\\u00e7a dos momentos que vivemos juntos.\\n\\nSeparei um presente especial: os registros oficiais do evento \\ud83d\\udcf8\\n\\nVoc\\u00ea brilhou e mostrou que um time \\u00e9 sempre mais forte do que um s\\u00f3! \\n\\nAt\\u00e9 a pr\\u00f3xima conven\\u00e7\\u00e3o! \\nPor mim, seremos amigos virtuais pra sempre \\ud83e\\udd16\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"URL\",\"text\":\"Veja as fotos aqui!\",\"url\":\"https:\\/\\/drive.google.com\\/drive\\/folders\\/1hKXneS7wIRhG0-atFm4Qgcm45USiVT_8?usp=sharing\"}]}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(4, '1256671432607388', 'althaia_video', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Oi, \\u00e9 a Alth@ de novo! \\n\\nJ\\u00e1 faz 02 semanas que estivemos juntos, acredita?\\n\\nEspero que esteja conseguindo aplicar tudo o que aprendeu na conven\\u00e7\\u00e3o. E pra relembrarmos nossos momentos juntos, como prometido, vamos disponibilizar o V\\u00eddeo Melhores Momentos.\\nRecordar \\u00e9 viver ;) .\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"URL\",\"text\":\"Clique e veja\",\"url\":\"https:\\/\\/www.youtube.com\\/watch?v=HO1q3Gar9fw\"}]}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(5, '757880117095167', 'resposta_feedback_2', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Muito obrigada! \\nEm breve voc\\u00ea receber\\u00e1 o v\\u00eddeo e ter\\u00e1 chance de rever os momentos mais incr\\u00edveis da conven\\u00e7\\u00e3o. \\ud83d\\udcf9\\ud83d\\ude09\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(6, '795938866171581', 'resposta_feedback_1', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Ebaa! \\ud83e\\udd73 Aqui est\\u00e1 o link do formul\\u00e1rio:\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"URL\",\"text\":\"Preencha agora!\",\"url\":\"https:\\/\\/forms.gle\\/vcxKvKqMi8EwQNw97\"}]}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(7, '1132964508753895', 'feedback_2', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Oi, aqui \\u00e9 a Alth@! \\ud83d\\udc99\\n\\nEu sei que a rotina depois da conven\\u00e7\\u00e3o deve estar uma correria, mas gostaria de lembrar que seu feedback sobre a Conven\\u00e7\\u00e3o de Vendas 2025 | Althaia Equaliv, \\u00e9 muito importante. \\nEnt\\u00e3o se ainda n\\u00e3o respondeu, agora \\u00e9 a hora! E olha s\\u00f3, quando 80% dos convidados tiverem respondido a nossa pesquisa, enviaremos o v\\u00eddeo \\u201cMelhores Momentos\\u201d do evento \\ud83d\\udcf9\\u2728\\n\\nQue tal me ajudar com essa miss\\u00e3o?\\n\\n1\\ufe0f\\u20e3 Quero preencher agora!\\n2\\ufe0f\\u20e3 J\\u00e1 preenchi.\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(8, '1299118261669796', 'msg_lembrete_feedback', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Oi, aqui \\u00e9 a Alth@! \\ud83d\\udc99\\n\\nEu sei que a rotina depois da conven\\u00e7\\u00e3o deve estar uma correria, mas gostaria de lembrar que seu feedback sobre a Conven\\u00e7\\u00e3o de Vendas 2025 | Althaia Equaliv, \\u00e9 muito importante. \\nEnt\\u00e3o se ainda n\\u00e3o respondeu, agora \\u00e9 a hora! E olha s\\u00f3, quando 80% dos convidados tiverem respondido a nossa pesquisa, enviaremos o v\\u00eddeo \\u201cMelhores Momentos\\u201d do evento \\ud83d\\udcf9\\u2728\\n\\nQue tal me ajudar com essa miss\\u00e3o?\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"QUICK_REPLY\",\"text\":\"Quero responder agora!\"},{\"type\":\"QUICK_REPLY\",\"text\":\"J\\u00e1 respondi.\"}]}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(9, '30782898254687444', 'bem_vindo', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Ol\\u00e1 {{name}}\\nSeja bem vindo a Apoio19\",\"example\":{\"body_text_named_params\":[{\"param_name\":\"name\",\"example\":\"Alan Borim\"}]}}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(10, '2372950542868789', 'hello_world', 'en_US', 'MARKETING', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"TEXT\",\"text\":\"Hello World\"},{\"type\":\"BODY\",\"text\":\"Welcome and congratulations!! This message demonstrates your ability to send a WhatsApp message notification from the Cloud API, hosted by Meta. Thank you for taking the time to test with us.\"},{\"type\":\"FOOTER\",\"text\":\"WhatsApp Business Platform sample message\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(11, '2369703703181883', 'sample_issue_resolution', 'en_US', 'UTILITY', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Hi {{1}}, were we able to solve the issue that you were facing?\"},{\"type\":\"FOOTER\",\"text\":\"This message is from an unverified business.\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"QUICK_REPLY\",\"text\":\"Yes\"},{\"type\":\"QUICK_REPLY\",\"text\":\"No\"}]}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(12, '1864839557039296', 'sample_flight_confirmation', 'pt_BR', 'UTILITY', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"DOCUMENT\"},{\"type\":\"BODY\",\"text\":\"Esta \\u00e9 a sua confirma\\u00e7\\u00e3o de voo para {{1}}-{{2}} em {{3}}.\"},{\"type\":\"FOOTER\",\"text\":\"Esta mensagem \\u00e9 de uma empresa n\\u00e3o verificada.\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(13, '1803828406658518', 'sample_happy_hour_announcement', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"HEADER\",\"format\":\"VIDEO\"},{\"type\":\"BODY\",\"text\":\"O happy hour chegou! \\ud83c\\udf7a\\ud83d\\ude00\\ud83c\\udf78\\nSeja feliz e aproveite o dia. \\ud83c\\udf89\\nLocal: {{1}}\\nHor\\u00e1rio: {{2}}\"},{\"type\":\"FOOTER\",\"text\":\"Esta mensagem \\u00e9 de uma empresa n\\u00e3o verificada.\"}]', '2026-01-24 23:00:26', '2026-02-27 12:26:51'),
(18, '1699738471007207', 'althaia_campanha_2026_msg1_rsp2', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Fique tranquilo(a)! \\n\\nApenas envie um e-mail com a sua d\\u00favida, para myrna.bueno@althaia.com.br, que voc\\u00ea ser\\u00e1 respondido(a) o quanto antes.\\n\\nEstou por aqui se ainda precisar de ajuda \\ud83d\\ude09\"}]', '2026-02-20 15:01:03', '2026-02-27 12:26:51'),
(19, '1233202275679141', 'althaia_campanha_2026_msg1_rsp_1', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Maravilha! \\n\\nEnt\\u00e3o, em breve, a gente se encontra para viver dias de evolu\\u00e7\\u00e3o em time.\"}]', '2026-02-20 15:01:03', '2026-02-27 12:26:51'),
(20, '1458259682594444', 'althaia_campanha_2026_msg1', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Ol\\u00e1! \\ud83d\\udc4b\\n\\n\\u00c9 a Inova, falando aqui. Lembra de mim? Sua assistente virtual favorita. \\n\\nJ\\u00e1 faz quase 1 ano, desde a \\u00faltima vez que nos falamos. E eu t\\u00f4 de volta para acompanhar voc\\u00ea ao longo da Conven\\u00e7\\u00e3o Epicenter 2026.\\n\\nEsse evento nasceu de uma convic\\u00e7\\u00e3o clara: a inova\\u00e7\\u00e3o n\\u00e3o \\u00e9 um ponto de chegada \\u2014 ela \\u00e9 um fluxo cont\\u00ednuo. \\u00c9 a for\\u00e7a do coletivo que nos leva al\\u00e9m.\\n\\nIsso s\\u00f3 reafirma o tema desse ano: Uma s\\u00f3 for\\u00e7a.\\n\\nVamos seguir juntos nesse fluxo!\\n\\nAs informa\\u00e7\\u00f5es sobre os voos j\\u00e1 foram enviadas, por e-mail. Voc\\u00ea ainda tem alguma d\\u00favida?\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"QUICK_REPLY\",\"text\":\"Est\\u00e1 tudo certo.\"},{\"type\":\"QUICK_REPLY\",\"text\":\"Ainda tenho d\\u00favidas.\"}]}]', '2026-02-20 15:01:03', '2026-02-27 12:26:51'),
(23, '1252666373498619', 'althaia_campanha_2026_msg3_rsp2', 'en', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Excelente \\ud83d\\ude0a\\n\\nOrganiza\\u00e7\\u00e3o individual fortalece o coletivo. Se surgir qualquer d\\u00favida antes da viagem, \\u00e9 s\\u00f3 me chamar \\ud83d\\udc99\"}]', '2026-02-26 23:40:46', '2026-02-27 12:26:51'),
(24, '2489818308201151', 'althaia_campanha_2026_msg3_rsp1', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Claro! Anota a\\u00ed \\ud83d\\uddd3\\ufe0f\\n\\n\\ud83d\\udccd *11\\/03 \\u201314h - 18h*: plen\\u00e1ria | 19h - 22h: jantar no hotel\\n\\ud83d\\udccd *12\\/03 \\u2013 8h - 18h*: plen\\u00e1ria |19h - 22h30: Noite na piscina \\u2013 Festa \\u201cDeixa Fluir\\u201d\\n\\ud83d\\udccd *13\\/03 \\u2013 8h - 11h30*: plen\\u00e1ria | 12h - 13h: almo\\u00e7o | 13h30: passeio \\u00e0s Cataratas |       20h00: jantar especial de encerramento.\\n\\ud83d\\udccd *14\\/03 \\u2013 Manh\\u00e3 livre e retorno*\\n\\nAssim, voc\\u00ea se organiza e deixa tudo fluir com leveza \\ud83d\\udca7\"}]', '2026-02-26 23:40:46', '2026-02-27 12:26:51'),
(25, '34081700491478298', 'althaia_campanha_2026_msg3', 'pt_BR', 'MARKETING', 'APPROVED', '[{\"type\":\"BODY\",\"text\":\"Ol\\u00e1, tudo bem?\\n\\nDe 11 a 14\\/03, viveremos juntos movimentos importantes!\\nPara seguir o fluxo e aproveitar cada momento, aqui v\\u00e3o algumas dicas do que levar na mala:\\n\\n\\u2714\\ufe0f Roupas e cal\\u00e7ados confort\\u00e1veis, para os dias de plen\\u00e1ria e atividades.\\n\\u2714\\ufe0f Protetor solar, repelente, bon\\u00e9 e \\u00f3culos de sol para nosso passeio nas Cataratas!\\n\\u2714\\ufe0f Produtos de higiene pessoal\\n\\u2714\\ufe0f Adaptador\\/carregador bivolt\\n\\u2714\\ufe0f Roupa de banho (para a piscina do hotel)\\n\\u2714\\ufe0f Look especial para a festa \\u201cDeixa Fluir\\u201d\\n\\n*Dress code da festa:* tons inspirados na \\u00e1gua (azul claro, azul profundo, verde \\u00e1gua, branco ou prata).\\n\\nQuer ver a agenda do evento?\"},{\"type\":\"BUTTONS\",\"buttons\":[{\"type\":\"QUICK_REPLY\",\"text\":\"Sim, por favor!\"},{\"type\":\"QUICK_REPLY\",\"text\":\"J\\u00e1 estou me organizando\"}]}]', '2026-02-26 23:40:46', '2026-02-27 12:26:51');
